import React from "react";
import {
    BrowserRouter as Router, Switch, Link
  } from "react-router-dom";
function Nav (){
return(
    <nav>
    <ul>
      <li> <Link to="/">Home</Link> </li>
      <li> <Link to="/Add">Add</Link> </li>
    </ul>
  </nav>
)
}

export default Nav
